syntax = "proto3";
import "google/protobuf/timestamp.proto";
import "google/protobuf/empty.proto";

package jane;

service PHAM {
  rpc GetNitro (google.protobuf.Empty) returns (NitroResponse);
  rpc Get
}



message NitroResponse {

  google.protobuf.Timestamp timestamp = 1;
  uint32 value = 2;
}